import React, { Component } from "react";
import User from "./user";

class Users extends Component {
  state = [
    { name: "John", age: 20 },
    { name: "Nick", age: 20 },
    { name: "Mark", age: 20 }
  ];
  render() {
    return (
      <div>
        <h1>{this.props.title}</h1>
        <User age="40">Mark</User>
        <User age="30">Nick</User>
        <User age="20">Tom</User>
      </div>
    );
  }
}

export default Users;
